import React from 'react'
import "./Menu.css"

export default function Menu() {
  return (
    <div className='Menu'>
        <div className="introductie">
            Welkom bij het week menu. Hier kun je zien wat er op tafel komt te staan bij het 
            gezamelijke diner.
        </div>

    </div>
  )
}
